    useParams,
    Link
} from "react-router-dom";
import {UseChargetpoint,UseDeleteChargetpoint} from "../../../hooks/api/index";
import { usePages } from "../../../hooks/usePages/Usepages";
import { editchargetpointof} from '../../../constants/urls';                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              


export const Onechargetpoint = () => {
    
    const {id}= useParams();
    const chargetpoint = UseChargetpoint(id);
    const {gotolist}=usePages();
    const DeleteChargetpoint = UseDeleteChargetpoint(id);

    const handledelete = (id) =>{
        DeleteChargetpoint(id).then(response => gotolist())
    }
    return(
        <div className="xs100 just_center">
            <div className="flex_dir_col centrado">
            
            <h1>{chargetpoint.identify}</h1>
            <div>
                <button className="xs20" onClick={handledelete}>Delete</button>
                <Link className="xs20" to={editchargetpointof(id)}>
                <button className="xs20">Edit</button>
                </Link>
            </div>
            
           
            </div>
        </div>
        )
}
